import React from 'react';
import Cards from './Cards';

const CardsList = ({ people }) => {

	const peo = (people) => {
		return(
			console.log("Hello")
		)
	}

	peo()

	return(
		<div>
			{ people && <Cards person = { (people[0]) }/> }			
		</div>
	)
}

export default CardsList;
